INSERT INTO `systemmessages` VALUES (1,'nl','account_activation','Welkom bij Hi Flanders! Verifieer je mailadres','Hi {{ user.firstName }},\n\nWij van Hi Flanders zijn blij dat je toetreedt tot onze community. Om je lidmaatschap te vervolledigen, moet je nog 1 ding doen:\n\nIk bevestig mijn mailadres\n<{{link}}>\n\nDenk eraan om dit binnen 7 dagen te doen, om zeker te zijn van toegang tot je account. \n\nNa bevestiging krijg je – tenzij je 30 of jonger bent - nog een mailtje met oproep tot betaling van het lidgeld (€ 10). Wanneer de betaling in orde is, kan je alle voordelen als Hi Flanders-lid eenvoudig online ontdekken: exclusieve voordelen, kortingen en inspiratie om er elke keer opnieuw een geweldige vakantie van te maken!\n\nHeb je vragen of ondervind je een probleem? Laat het ons weten via hi@hiflanders.be of bel +32 3 232 72 18 tijdens de kantooruren. \n\nWarme groet,\n\nHet Hi Flanders-team\n','2025-01-09 09:13:04','2025-03-17 09:41:28','c87a0acf-13fc-4aed-9c72-8389df2e084b'),(2,'nl','verify_new_email','Bevestig je nieuwe e-mailadres','Hallo,\n\nKlik op deze link om je nieuwe e-mailadres te bevestigen:\n\n<{{link}}>\n\nAls je deze e-mail niet verwachtte, kun je hem gewoon negeren.','2025-01-09 09:14:09','2025-01-09 09:14:09','9f480054-8ef2-4dbc-aeba-aa71008f7591'),(3,'nl','forgot_password','Reset je wachtwoord voor Hi Flanders','Hi {{ user.firstName }},\n\nJe deed via onze website een aanvraag om je wachtwoord opnieuw in te stellen. Klik op de link:\n\n<{{link}}>\n\nHeb je dit verzoek niet zelf ingediend? Dan mag je deze e-mail negeren. Of neem contact met ons op via hi@hiflanders.be.\n\nTot binnenkort in een van onze hostels? Laat je verrassen door onze exclusieve voordelen, kortingen en inspiratie.\n\nWarme groet,\n\nHet Hi Flanders-team\n','2025-01-09 09:14:52','2025-02-03 15:56:57','e4a0649d-36b0-4f6d-8145-6e773bd45d60'),(4,'nl','custom_email_key','Custom Email Subject','Hello {{ user.username }},<br><br>This is a custom email body.<br><br>Thank you! aangepast','2025-01-27 14:32:59','2025-01-27 14:32:59','4fdd3e0a-b663-4d83-a192-84e143a1d5c0'),(5,'fr','account_activation','Bienvenue chez Hi Flanders ! Vérifiez votre adresse e-mail','Bonjour  {{user.friendlyName|e}},\n\nNous sommes ravis de vous accueillir dans la communauté Hi Flanders ! Il ne vous reste plus qu’une seule étape pour finaliser votre adhésion :\n\nJe confirme mon adresse e-mail\n<{{link}}>\n\nPensez à le faire dans les 7 jours afin de garantir l’accès à votre compte.\n\nAprès confirmation, vous recevrez – sauf si vous avez moins de 31 ans et bénéficiez d’une adhésion gratuite – un e-mail vous invitant à régler la cotisation d’adhésion (10 €). Une fois le paiement effectué, vous pourrez découvrir tous les avantages de votre adhésion Hi Flanders en ligne : offres exclusives, réductions et inspirations pour faire de chaque séjour une expérience inoubliable !\n\nUne question ? Besoin d’aide ? Contactez-nous à hi@hiflanders.be ou par téléphone au +32 3 232 72 18 (pendant les heures de bureau).\n\nChaleureusement,\n\nL’équipe Hi Flanders\n','2025-02-12 13:05:08','2025-02-12 13:05:08','a8d85592-ef1c-4c4e-ac4f-646fde17803c'),(6,'fr','forgot_password','Réinitialisez votre mot de passe pour Hi Flanders','Bonjour  {{user.friendlyName|e}},\n\nVous avez demandé à réinitialiser votre mot de passe via notre site web. Cliquez sur le bouton ci-dessous pour procéder :\n\n<{{link}}>\n\nSi vous n’avez pas fait cette demande, vous pouvez simplement ignorer cet e-mail. Vous pouvez également nous contacter à hi@hiflanders.be. \n\nÀ bientôt dans l’une de nos auberges ! Profitez de nos avantages exclusifs, réductions et inspirations pour vos futurs séjours.\n\nChaleureusement,\n\nL’équipe Hi Flanders\n','2025-02-12 14:33:45','2025-02-12 14:33:45','40a62454-87d0-4924-88df-c8ca57854721'),(7,'en','account_activation','Welcome to Hi Flanders! Verify your email address','Hi {{user.friendlyName|e}},\n\nWe at Hi Flanders are excited to welcome you to our community! To complete your membership, there’s just one more thing to do:\n\n<{{link}}>\n\nPlease do this within 7 days to ensure access to your account.\n\nOnce confirmed, you will receive another email with payment instructions for the membership fee (€10) – unless you are under 31, in which case your membership is free.\nOnce your payment is processed, you can start enjoying all the benefits of being a Hi Flanders member: exclusive benefits and discounts, and plenty of inspiration to make every trip an unforgettable experience!\n\nNeed help?\nIf you have any questions or run into any issues, feel free to contact us at hi@hiflanders.be or call +32 3 232 72 18 during office hours.\n\nWarm regards,\n\nThe Hi Flanders Team\n','2025-02-13 08:12:49','2025-02-13 08:12:49','68b248b2-5f55-43f6-b2d4-255abb58ea8b'),(8,'en','forgot_password','Reset your password','Hi {{user.friendlyName|e}},\n\nYou recently requested a password reset via our website. Click the button below:\n\n<{{link}}>\n\n(This link will remain valid for … hours.)\n\nDidn’t request this yourself? Then you can ignore this email. Or contact us at hi@hiflanders.be.\n\nWe hope to welcome you soon at one of our hostels! Enjoy our exclusive benefits, discounts and travel inspiration.\n\nWarm regards,\n\nThe Hi Flanders Team\n','2025-02-13 09:48:57','2025-02-13 09:48:57','f6e590d9-cff7-431b-870b-2bd1474394a8');
